    "2013-03-14T19:45:14.091623",nt"name": "planning-districts-2004-east-baton-rouge-parish-louisiana",nt"isopen":
    false,nt"url": null,nt"notes": "This is a graphical polygon dataset depicting
    the polygon boundaries of the 16 Planning Districts of the East Baton Rouge Parish
    of the State of Louisiana. The Planning Districts within East Baton Rouge Parish
    (EBR) were created during the inception of the Horizon Plan (1992) and are based
    on census tract boundaries. Sixteen (16) planning districts in East Baton Rouge
    Parish are completed, beginning with Districts 1 and 2 covering the northwest and
    northeast portions of the Parish, respectively and ending with District 16 in the
    southern part of the parish. Planning Districts representing the East Baton Rouge
    Parish cover an area of 472.1 square miles on the east bank of the Mississippi River
    in south central Louisiana. This dataset conveys the best currently (2004) available
    representation of the EBR parish of Louisiana. Each Planning District contains up
    to 5 subareas, excluding Baker and Zachary City Limits.",nt"license_title":
